import { useState } from 'react';
import { useForm } from 'react-hook-form';

const PatientRegistration = () => {

    //const [registration, setRegistration] = useState();

    const { register, handleSubmit, errors } = useForm();

    // const inputHandler = (e) => {
    //     const name = e.target.name;
    //     const value = e.target.name;
    //     setRegistration({...registration, [name]: value});
    // }

    const submitHandler = (data) => {
        // e.preventDefault();
        // e.stopPropagation();

        // const patient_id = document.getElementsByName('patient_id').value;
        // const name = document.getElementsByName('name').value;
        // const email = document.getElementsByName('email').value;
        // const password = document.getElementsByName('password').value;
        // const confirm_password = document.getElementsByName('confirm_password').value;
        // const aadhar = document.getElementsByName('aadhar').value;
        // const city = document.getElementsByName('city').value;
        console.log(data);



    }

    return (
        <form onSubmit={handleSubmit(submitHandler)} method="post">
            <p>Please fill in this form to create an account!</p>
            <hr />
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="text" class="form-control" name="patient_id" placeholder="Patient ID" 
                        {...register('patient_id', { required: true })}
                    
                    />  </div>
                    <div class="col"><input type="text" class="form-control" name="name" placeholder="Name" 
                        
                     /></div>
                </div>
            </div>
            <div class="form-group">
                <input type="email" class="form-control" name="email" placeholder="Email" 
                    
                 />
            </div>
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="password" class="form-control" name="password" placeholder="Password" 
                        
                     /></div>
                    <div class="col"><input type="password" class="form-control" name="confirm_password" placeholder="Confirm Password" 
                        
                     /></div>
                </div>
            </div>
            <div class="form-group">
                <input type="text" class="form-control" name="mobile" placeholder="Mobile" 
                    
                 />
            </div>
            <div class="form-group">
                <input type="text" class="form-control" name="aadhar" placeholder="Aadhar" 
                    
                 />
            </div>
            <div class="form-group">
                <div class="row">
                    <div class="col"><input type="text" class="form-control" name="address" placeholder="Address" 
                        
                     /></div>
                    <div class="col-4"><input type="text" class="form-control" name="city" placeholder="City" 
                        
                     /></div>
                </div>
            </div>
            <div class="form-group">
                <input type="text" class="form-control" name="confirm_password" placeholder="Date of Birth" 
                    
                 />
            </div>
            <div class="form-group">
                <label class="form-check-label"><input type="checkbox" 
                    
                 /> I hereby declare that the above information is true to the best of my knowledge.</label>
            </div>
            <div class="form-group">
                <button type="submit" class="btn btn-primary btn-lg text-dark">Sign Up</button>
            </div>
        </form>
    )
}

export default PatientRegistration
